import '../GST/GST.css';
import ServiceSideMenu from '../../UI/ServiceSideMenu/ServiceSideMenu';


class StartBusiness extends Component {

    state = {
        selectedService : 'GST_Registration', 
        selectedMenu: 'Definition',
    }
    services = [
            "Private Limited Company",
            "Public Limited Company",
            "Limited Liability Partnership",
            "One Person Company",
            "Subsidiary of Foreign Company",
            "Partnership Firm",
            "Proprietorship",
            "Non Profit Organisations"
    ];
    GstRegistrationMenu = [
        "Definition",
        "Inclusion",
        "Procedures",
        "Documents",
        "Advantages",
        "FAQs"
    ]
    changeServiceHandler = (service) => {
        this.setState({
            selectedService:service
        })
    }
    changeMenuHandler = (menu) => {
        this.setState({
            selectedMenu: menu
        })
    }
    render() {
        let activeService = null ;
        // switch(this.state.selectedService){
        //     case this.services[0]:
        //         activeService = (<GstRegistration menu={this.GstRegistrationMenu} clicked={this.changeMenuHandler} selectedMenu={this.state.selectedMenu}/>);
        //         break;
        //     case this.services[1]:
        //         activeService = (<GstFiling menu={this.GstRegistrationMenu} clicked={this.changeMenuHandler} selectedMenu={this.state.selectedMenu}/>);
        //         break;
        //     default:
        //         activeService=(<GstRegistration menu={this.GstRegistrationMenu} clicked={this.changeMenuHandler} selectedMenu={this.state.selectedMenu}/>);
        // }
        return (
            <section className="Service">
                <ServiceSideMenu services={this.services} title="Start Business" clicked={this.changeServiceHandler} activeService={this.state.selectedService}/>
                <div className="ServiceDescription">
                    {activeService}
                </div>
            </section>
        );
    }

}

export default StartBusiness;
